import {
  BrowserRouter,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Home from './pages/Home';

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route  exact path="/" component={Home} />
      </Switch>
    </BrowserRouter>
  );
}

export default App;
